review:
This is a good solution, but you can optimize it by using ES6 Set object which automatically removes duplicates.

```javascript
axe.utils.uniqueArray = (arr1, arr2) => {
  const set1 = new Set(arr1);
  const set2 = new Set(arr2);
  return [...set1,...set2].filter((elem, pos, arr) => {
    return arr.indexOf(elem) === pos;
  });
};
```
This will reduce the time complexity from O(n^2) to O(n).

